import React from 'react'
import TextField from 'material-ui/TextField';
import PropTypes from "prop-types";
import { withStyles } from '@material-ui/core/styles';
import DatePicker from 'material-ui/DatePicker'
// import RaisedButton from 'material-ui/RaisedButton';
// import { Button, Form, Grid, Header, Image, Message, Segment, Input, Label } from 'semantic-ui-react'

const styles = theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: 200,
  },
});


class RecipientInfo extends React.Component {


  render(){
    const { classes, page1, handleChange, handleChangeDate, mainState, pDob } = this.props

    return (
        <React.Fragment>
          {page1.map(dataObj =>
            { const name1 = dataObj.name
              return (
                < React.Fragment>
                  <TextField
                  hintText="Please type..."
                  floatingLabelText={dataObj.label}
                  onChange={handleChange}
                  data-category={dataObj.category}
                  defaultValue={mainState[name1]}
                  name={name1}
                  fullWidth
                  margin="normal"
                  />
                  < br />
                < /React.Fragment>)
            }
          )}
          < br />
          <DatePicker
            hintText="Patient's Date of Birth"
            value={pDob}
            onChange={handleChangeDate}
            />
        </React.Fragment>

    )
   }
  }
  RecipientInfo.propTypes = {
    classes: PropTypes.object.isRequired,
  };

export default withStyles(styles)(RecipientInfo)
